import React, { Component } from 'react';

import Button from 'react-bootstrap/Button'
import { NavLink } from 'react-router-dom'

import StarPlayerFilter from './components/StarPlayerFilter';

class SelectionButton extends Component {

    render() {
        const name = this.props.name.toLowerCase();
        return (
            <NavLink to={`/${name}`} activeStyle={{ disabled: true }} id={name}><Button>{this.props.name}</Button></NavLink>
        )
        const starname = this.props.starname.toLowerCase();
        return (
            <NavLink to={`/${star_players}`} activeStyle={{ disabled: true }} id={name}><Button>{this.props.starname}</Button></NavLink>
        )
    }
}

export default SelectionButton
